<script>
export default {
  name: 'BaseBlogTileArt',
  // image should have 16:9 aspect ratio
  props: {
    title: {
      type: String,
      required: true,
      validator(value) {
        return typeof value === 'string'
      }
    },
    subtitle: {
      type: String,
      required: true,
      validator(value) {
        return typeof value === 'string'
      }
    },
    color: {
      type: String,
      required: false,
      default: '#ccc',
      validator(value) {
        // hex, rgb(a) and red | green | blue
        const color = /red|green|blue|(#([\da-f]{3}){1,2}|(rgb|hsl)a\((\d{1,3}%?,\s?){3}(1|0?\.\d+)\)|(rgb|hsl)\(\d{1,3}%?(,\s?\d{1,3}%?){2}\))/gi
        const regex = new RegExp(color)
        return value.match(regex)
      }
    }
  },
  computed: {
    _color() {
      let color = this.color

      switch (color) {
        case 'red':
          color = '#ec6d5f'
          break
        case 'green':
          color = '#27c9b8'
          break
        case 'blue':
          color = '#2caaca'
          break
      }

      // const rgb = this.hexToRGB(color)

      return {
        // 'border-left-color': color,
        fill: color,
        opacity: 0.2
      }
    },
    _colorsubtitle() {
      let col = this.color

      switch (col) {
        case 'red':
          col = '#ec6d5f'
          break
        case 'green':
          col = '#27c9b8'
          break
        case 'blue':
          col = '#2caaca'
          break
      }

      // const rgb = this.hexToRGB(color)

      return {
        // 'border-left-color': color,
        color: col
      }
    }
  },
  methods: {
    hexToRGB(hex) {
      const result = /^#?([a-f\d]{2})([a-f\d]{2})([a-f\d]{2})$/i.exec(hex)
      return result
        ? {
            r: parseInt(result[1], 16),
            g: parseInt(result[2], 16),
            b: parseInt(result[3], 16)
          }
        : null
    }
  }
}
</script>

